import { Container, Row, Col, Breadcrumb, BreadcrumbItem } from "shards-react";
import Collapsible from "react-collapsible";

// Home components
import HomeCarousel from "../home/HomeCarousel";
import Marketing from "../home/Marketing";
import MailingListSubscribe from "../home/MailingListSubscribe";

// Layout
import Layout from "../components/Layout";

const Index = props => (
  <Layout>
    <Collapsible trigger={<a href>Start here</a>}>
      <p>
        This is the collapsible content. It can be any element or React
        component you like.
      </p>
      <p>
        It can even be another Collapsible component. Check out the next
        section!
      </p>
    </Collapsible>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem active>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/"></a>
        </BreadcrumbItem>
      </Breadcrumb>
    </Container>
    <HomeCarousel />
    <Container>
      <hr />
      <Marketing />
    </Container>
  </Layout>
);

export default Index;
